    false,nt"url": null,nt"notes": "This map layer contains mortality information
    for United States Health Service Areas (805 groups of counties). Included are mortality
    rates by sex and race (white and black) for the 11 leading causes of death, 8 subset
    causes, and all causes combined, for 1988-1992. Age-adjusted rates are presented
    along with indicators of whether each rate is considered reliable and whether it
    is significantly different from the corresponding U.S. rate. This is a revised version
    of the 1998 data set. This data set was also distributed with the name U.S. Mortality
    Database.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
